Water_Intensity_1.query:
q = load "${App.Datasets.Demo_Water_Management.FullyQualifiedName}";
q = group q by 'ReportPeriod_Year';
q = foreach q generate 'ReportPeriod_Year' as 'ReportPeriod_Year', 
avg('EmployeeCount') as 'Based on Employee Count', avg('FloorArea') as 'Based on Floor Area', avg('UnitsManufactured') as 'Based on Units Manufactured';
q = order q by 'ReportPeriod_Year' asc;

Name_EndDate_Year_1__9.query:
q = load "${App.Datasets.Demo_Water_Management.FullyQualifiedName}";
q = group q by ('ReportPeriod_Year', 'ReportPeriod_Month');
q = foreach q generate 'ReportPeriod_Year' + "~~~" + 'ReportPeriod_Month' as 'StartDate_Year~~~StartDate_Month', sum('DischargedPerDay') as 'Water Discharge';
q = order q by 'StartDate_Year~~~StartDate_Month' asc;
q = limit q 2000;

